import React, { Component } from 'react'

class Login extends Component {
    render() {
        return (
            <div class="login">
                <div class="help-center">
                    Gagal masukkan data? <a href="#">Hubungi admin</a>
                </div>
                <div class="row">
                    <div class="col-sm-5">
                        <div class="container-fluid">
                            <h1>Masuk</h1>
                        </div>
                    </div>
                </div>
            </div> 
        )
    }
}
export default Login;
